import React from 'react';
import { findByLabelText } from '@testing-library/react';

function Home() {

    const homeStyle = {
        height: '120vmin',
        backgroundImage: 'url("/images/construction1.jpg")',
        backgroundRepeat: 'no-repeat',
        backgroundSize: '100% auto',
        position: 'absolute',
        top: '0',
        left: '0',
        right: '0',
        zIndex: 100,
    }

  return (
    <div style={ homeStyle } className="content">
      <h2 className="white">Washington, DC Building Restoration, Repair &amp; Waterproofing</h2>
    </div>
  );
}

export default Home;
